    [MPL_TOKEN_METADATA_ERROR__TOKEN_CLOSE_FAILED]: `Token close failed`,
    [MPL_TOKEN_METADATA_ERROR__TOKEN_MINT_TO_FAILED]: `Token mint to failed`,
